Here is a JavaScript function that sorts a provided list of numbers in a descending order and returns a string with the numbers separated by a comma -
```
function sortDescending(numbers) {
  numbers.sort((a, b) => b - a);
  return numbers.join(', ');
}
```

To call this function, provide the comma-separated list of numbers as a string argument -
```
sortDescending("12, 34, 56, 78");
// Result: "78, 56, 34, 12"
```
